(12, '', '2020/11/08 10:44:56 PM MST', '', 'Student', 'Library Office;College of Teacher Education', 'For betterment of the study and University', 'Nemesio G. Loayon (CTE)\n\nMs. España (Library)', '5-Excellent', 'Compliment;Rendered services beyond expectation', 'Dr. Loayon- A good leader to his fellow workers and a good motivator like Dr. Karla. There was a time when most of us felt down but they encouraged us to paddle the boat and reach the coastline.\n\nMs España- Approachable. Everytime I ask her about books to read, she humbly suggested good reading materials and conducted good ambiance in the library with her co-staffs.', 'I proudly recommend these kind of people to continue their good services and to encourage more along their way.', 'old'),
(13, '', '2020/11/08 10:45:59 PM MST', '', 'Student', 'Registrar Office;Cashier;Library Office', 'For Enrollment', 'Cashier', '4-Good', 'Suggestion', 'Slow transaction', 'The 4 windows should open/operate for faster transaction', 'old'),
(14, '', '2020/11/08 10:48:18 PM MST', '', 'Student', 'Registrar Office;Cashier;Library Office;College of Teacher Education;Computer Laboratory', 'To gather information and to settle money obligations', 'Librarian,Instructors,', '5-Excellent', 'Compliment', 'The officer incharge in the different offices mentioned and the teachers in the college of teacher education rendered good services by providing the needs of the students, and by showjng respect to students.', 'Just always make the offices comfortable to students..The officers inside the different offices should also be friendly because students get hesitant to visit the office because of the atmosphere and the attitude of the workers inside the office.', 'old'),
