(16, '', '2020/11/08 11:06:00 PM MST', '', 'Student', 'Registrar Office', 'requested a TOR', 'Registrar staff- (job order)', '2-Poor(Needs Improvement)', 'Complaint', 'The TOR as the Registrar promised is supposed to be released for a week but it was released for almost a month after i kept on coming back for many many  times already. ', 'release the TOR as soon as possible', 'old'),
