(18, '', '2020/11/08 11:15:35 PM MST', '', 'Student', 'Cashier;Graduate Studies', 'To enroll MAED course', 'GLESILDA L. CANDA', '4-Good', 'Suggestion;The personnel who are assigned to accept payments via Palawan express for payments such as tuition fees and others miscellaneous fees should be updated daily and the customer must aware the status of his /her payments. ', 'I satisfied with the services that offered by SDSSU but a little bit problem when it comes to payments services, I had been experienced a delay response of the personnel who assigned in accepting payments via palawan padala express.', 'I suggest that there is need to upgrade and enhance the process of accepting payments that the customer must be updated and accessible and know the status of his/her transactions.', 'old'),
