(22, '', '2020/11/09 12:23:29 AM MST', '', 'Student', 'Registrar Office', 'Enrollment - ID number', 'I can\'t remember anymore (In-charge to answer phone calls)', '3-Satisfactory', 'Suggestion', 'She told me to check my email the ID number will be sent but it took a week to discover that there\'s no ID number created because of the system my account could not be seen because I checked the Cantilan campus.', 'Hope the in charge is well oriented with the process of the enrollment system than let the enrollee waited for one week but did not get the right answer to the queries. ', 'old'),
