(28, '', '2020/11/09 3:30:31 AM MST', '', 'Student', 'Registrar Office;Cashier;Graduate school office', 'Enrolment and grade request', 'Graduate school staff ,Registrar and cashier', '3-Satisfactory', 'Suggestion', '1. The hotlines are out of coverage and staff from this office are difficult to contact and not responsive to client transaction\n2.  Sometimes if you will call the hotline through phone it just keeps on ringing but no one answers\n3. No proper communication between the graduate school  of Lianga Campus and the Main campus. Too much burden experienced by most of the students from Lianga campus whenever we ask grades.. our grades are delayed because of  the current system that the prof from lianga needs to personally entry the grades in the main campus... \n\n', 'Please improve the communication system... ', 'old'),
(29, '', '2020/11/09 3:33:54 AM MST', '', 'Student', 'Registrar Office;Guidance Office;Library Office;College of Teacher Education', 'Enrollment', 'Ms. Maisa Avila and Sir Raman', '4-Good', 'Suggestion', 'Some personnel are too busy because of the numerous number of students to be entertain.', 'I am expressed on how they serve and accommodate the students. They were very approachable and ensuring that everyone is doing well inside the campus.', 'old'),
