(38, '', '2020/11/10 1:01:36 AM MST', '', 'Student', 'Guidance Office', 'Virtual Counseling Session', 'SDSSU Guidance Counselor (I forgot her full name)', '5-Excellent', 'Compliment', 'I was super depressed during the whole month of October.  I\'ve had passive suicidal thoughts. I\'d been thinking about all the traumas I\'ve experienced over the past twenty years of my existence. I grew up having parent-figures who don\'t have good parenting education and had been gaslighting me with their own values which are self-interest in disguise. I haven\'t eaten properly for weeks because we had a financial crisis last month. There\'s an instructor who triggered my trauma and my emotional reactivity was at its peak during that time. After the virtual meeting, I cried so hard at home. My chest was extremely painful. I decided to send an application to the guidance center of our university, so I can get psychological guidance with my emotions which cannot be solved through prayers during that moment. I\'ve been in the office for twice already to ask help on how to get over/heal from my autopilot state. The Guidance Counselor was really good at giving me advices and tips that might best help me. We had such a healthy conversation and I can really tell that the SDSSU Guidance Center has been my safe outlet to express my problems which I\'ve been keeping in my chest for so long. ', 'The only thing I can suggest as of the moment is the application process when you want to have a virtual counseling with them. It took me a day to wait for their response, and I was a bit healed the moment they have contacted me. Due to my better state, I wasn\'t really able to express properly what happened. I just told them the things a rational person would do when you hit rock bottom which I think is not authentic anymore. However, I understand because not everything is easy nowadays. The pandemic altered our modes of communication. Life has been twice as tough amidst the crisis and we have to be super understanding with each other even if we\'re miles away.', 'old'),
