(75, '', '2020/11/10 9:33:38 PM MST', '', 'Student', 'Registrar Office', 'For enrollment', 'The technichal assistant.', '4-Good', 'Compliment', 'My student ID was mistakenly used by another student, and by that time I cannot access to the enrollment form and can\'t sign up for my account. Thanks to the Registrar Office that provided me someone that can help me with my problem. The technical assistant contacted the person who used my ID number to resolve the problem. And eventually I receive my ID number back and was able to sign up for my account for enrollment.', 'I recommend secure system that assigned each student with designated ID number that can\'t just be input by any student who\'ll try to sign up.', 'old'),
