(78, '', '2020/11/10 10:37:11 PM MST', '', 'Student', 'Clinic', 'Medical consultation', 'School Nurse', '4-Good', 'Suggestion', 'I have a fever that day so I go to the clinic to have medical consultation then they gave me medicine that would help me lessen the fever I felt.', 'I suggest that They should be like that always', 'old'),
(79, '', '2020/11/10 10:58:05 PM MST', '', 'Student', 'Registrar Office;Accounting Office;Clinic;Budget Office;Cashier;Guidance Office;Library Office;Administration Office;College of Arts and Sciences;College of Teacher Education;College of Engineering;College of Information and Technology Education;College of Business and Management', 'Borrow books transaction of documents ', 'Registrar, library head', '5-Excellent', 'Compliment', 'Not all students can accommodate in the registrar especially if enrollment, giving scholarship, etc. Also the books in the library are mix and because some of the students will not arrange the book properly after they used. ', 'I suggest that the books in the library should be added and updated. Also in every department there are free WiFi so that the students can easily access. ', 'old'),
