(94, '', '2020/12/09 11:52:19 AM MST', '', 'Student', 'Registrar Office;College of Business and Management', 'Inquiries for Semestral Final Grade', 'Registrar Pffice and CBM Office', '2-Poor(Needs Improvement)', 'Suggestion;I want to suggest that Registrar and CBM Department shall maka a website either posted in Official SDSSU website so that we can access our Final Grade in semester and downloaded by ourselves.  For example,  we can download our final grade in semester by putting our ID number on search bar for ease service transaction ', 'It\'s hard especially CBM Dean,  VPAA are not responsive to our concern.  Alsoz they should posted their email account or representative account in order to easily contact them for report and inquires.  ', 'I want to suggest that Registrar and CBM Department shall make a website either posted in Official SDSSU website so that we can access our Final Grade in semester and downloaded by ourselves.  For example,  we can download our final grade in semester by putting our ID number on search bar for ease service transaction because as what I observe during a new mode of learning way back July it is so hard for us to download our final grade.  Some are not given from us,  our parents also wanted to monitor our grades by semester.  Hopefully,  this would make a change. ', 'old'),
