(170, '', '2021/03/10 7:13:43 PM MST', '', 'Student', 'Registrar Office;College of Teacher Education', 'Requesting for grades and asking for my enrollment.', 'Secretary', '4-Good', 'Complaint', 'I fill out immediately my enrollment form in the SDSSU PREENROLLMENT SYSTEM but it takes almost 3 weeks before I saw my status evaluated and enrolled. I also chatted the CTE facebook account a multiple times with regards to my grades for the first semester but it comes out that I request my classmate who got his grades first to ask for mine, before I saw my grades. ', 'I fully understood their work or services towards hundreds of students. It takes more time for them to entertained us individually. But I recommend to treat students equally and provide more people or staff to help them. In that way, their work will be easy to give each students\' needs.', 'old'),
(171, '', '2021/03/10 7:14:08 PM MST', '', 'Student', 'College of Teacher Education', 'Copy of Grades', 'Department Secretary', '5-Excellent', 'Compliment', 'I asked for a validated copy of my grades to our department secretary and he sent it to me right after seeing my message.', 'None', 'old'),
(172, '', '2021/03/10 7:15:03 PM MST', '', 'Student', 'Registrar Office;Accounting Office;Clinic;Budget Office;Cashier;Guidance Office;Library Office;Administration Office;College of Teacher Education', 'Survey', 'CTE Secretary', '5-Excellent', 'Compliment', 'I don\'t have any complaint for the University itself serves the best.', 'I recommend to continue doing your job for the service of excellence.', 'old'),
(173, '', '2021/03/10 7:15:20 PM MST', '', 'Student', 'Registrar Office;Clinic;Cashier;Guidance Office;Library Office;Administration Office;College of Arts and Sciences;College of Teacher Education;College of Engineering;College of Information and Technology Education;College of Business and Management', 'To print my handouts', 'ICT office', '2-Poor(Needs Improvement)', 'Complaint', 'It was happened last year during face-to-face classes. I thought I can save if I print my handouts and compilation inside our school but I was dissapointed. Even I provide the bondpaper, the price of it is still the same.', 'My suggestion is hopefully the students can pay half price only because it was printed inside our school. Which means school also help us in a little.', 'old'),
(174, '', '2021/03/10 7:15:30 PM MST', '', 'Student', 'Registrar Office;College of Teacher Education', 'Update enrolment status, and study for trusted education', 'CTE PERSONNELS AND REGISTRAR ', '5-Excellent', 'Compliment', 'Despite of having this online set-up, the university and other essential personnel really worked hard to help students with their academic state, though it will takes a lot of time to respond to one\'s concerns because of the students\' population.', 'I suggests to create a online platform which is less costly for students to do the virtual class. Also, I might suggest to assigned persons every department from the registrar\'s office so that the enrolment process would be a little bit fast.', 'old'),
(175, '', '2021/03/10 7:15:34 PM MST', '', 'Student', 'None', 'None', 'None', '4-Good', 'None', 'Everything is fine.', 'All good.', 'old'),
(176, '', '2021/03/10 7:15:37 PM MST', '', 'Student', 'Registrar Office;College of Teacher Education', 'Requesting for the first semester grades, and to update enrollment status.', 'Secretary', '3-Satisfactory', 'Complaint;The enrollment process was a bit slow. Although we were given a lot of days to fill up the forms for the pre enrollment and enrollment, but it took us a long time to become officially enrolled. ', 'The staff cannot accomodate the students immediately because of the rise of students\' population.', 'Since there is a rise of student population, the school must employ additional staff so that they can easily accomodate students.', 'old'),
