(181, '', '2021/03/10 7:18:40 PM MST', '', 'Student', 'College of Teacher Education', 'Rating the goodness of her teaching.', 'Karla Jeane P. Roz EdD', '4-Good', 'Compliment', 'I just want to compliment the teaching style of the teacher.', 'Nothing at all, keep up the good work!', 'old'),
(182, '', '2021/03/10 7:18:48 PM MST', '', 'Student', 'Accounting Office;Guidance Office;College of Teacher Education', 'Academic transactions in the college, activity proposals (in my debate org and SSG), project pitches for school funding, and seeking counseling services.', 'Accounting Office - Ma\'am Coleen\nGuidance Office - Ma\'am Joan Zartiga\nCollege of Teacher Education - All CTE Faculty & Staff\n', '5-Excellent', 'Compliment;The services for this semester were really accessible and inclusive even if the means of transactions were mostly done/operated online. I laud the kindness and understanding of all the teachers and faculty staff I\'ve encountered along the way. They\'re really approachable. They appease my concerns. Overall, I am satisfied with the customer/student services given by the school administration this semester. ', 'As a student and an SSG officer this year, I have an access to enter the campus more often than my classmates. I used to visit the accounting office frequently to transact our activity proposals and project pitches from the SSG and even in my debate organization. My experience with their services were simple and less hassle because the accounting office always budge in and appease my queries if I approach them. The people there were really approachable and kind.\n\nI also got to visit the Guidance Center nowadays. In all honesty, I was counselled three times already because of my mental health problems. I\'ve had an e-counseling service last semester because I was so stressed and emotionally beat up with the pressure and challenges of the new normal type of classes. This semester, I got lucky because I was counselled face to face by the guidance counselor. It\'s different and it\'s intimate. Ma\'am Zartiga was really kind and understanding.  The SDSSU Guidance Center was indeed truly a safe outlet to express my emotions without having the fear to be judged and ridiculed.\n\nLastly, my college department has always been supportive and approachable with my concerns. The whole faculty and staff from CTE is really finding ways to overcome the road blocks of education. I am very proud for being a part of this college. ', 'None so far. Just keep on looking ways for improvements and developments.', 'old'),
