(335, '', '2022/04/14 3:23:15 AM MDT', '', 'Student', 'Registrar Office', '', '', '5-Excellent', 'Suggestion', 'it is national graduates day the skills  qualifications and experience that i have gained as a students from studying with university are now needed more than ever  studying at university has played a huge part in my personal and professional development  the mba programme has allowed me to develop skills in areas such as entrepreneurship  communications  leadership and research  it goes without saying that      has been a challenge  both personally and in terms of my study  however  i have pulled through by staying positive  fully engaging in online study and keeping in touch with loved ones i graduated in october and i am feeling immensely proud  overcoming the challenges which the pandemic    pandemic has presented feels even more rewarding  i have the confidence  courage and skills to achieve my dreams in the world of management thanks to my experience in university ', 'i have gained a lot of co curricular experience as well as academic achievement  although i do not think it is counted as a vibrant university life  sometimes i like the quiet but ongoing student life ', 'old'),
(336, '', '2022/04/14 3:27:11 AM MDT', '', 'Student', 'College of Information and Technology Education', '', '', '2-Poor(Needs Improvement)', 'Complaint', 'wish i never accepted their offer and id advise for future students to do good research on universities before accepting their offer ', 'not at all what i expected  the quality of the majority of lecturers as well as fellow students is very low  please note that i am talking about the university', 'old'),
(337, '', '2022/04/14 3:29:08 AM MDT', '', 'Student', 'College of Engineering', '', '', '5-Excellent', 'Suggestion', 'quite good  i made lots of friends and the university building are great  such a shame my second and third year has gone so fast and in lockdown but my first year was awesome and finding the perfect balance between my studies and having fun has been amazing  i really have had a good time', 'i have loved my time here and i hope to continue  genuinely has been the time of my life and has taught me so much about myself and shown me that i can overcome any obstacle that gets in my way ', 'old'),
(338, '', '2022/04/14 3:31:10 AM MDT', '', 'Student', 'College of Business and Management', '', '', '5-Excellent', 'Compliment;Suggestion', 'great honestly  the resources are great and the lecturers have been very helpful throughout my course  only thing to work on is making societies more inclusi have ', 'i never expected to enjoy online learning as much as i am  it is incredibly flexible and i am getting the same quality of teaching as what i would if i was on campus ', 'old'),
